int maxNonOverlapping(vector<int> &nums, int target)
{
    int cnt = 0;
    int len = nums.size();
    vector<vector<int>> dp(len, vector<int>(len, -1));
    int x;
    for (int i = len - 1; i >= 0; i--)
    {
        int sum = nums[i];
        for (int j = i; j < len; j++)
        {
            if (j > i)
            {
                sum += nums[j];
            }
            dp[i][j] = sum;
            if (sum == target)
            {
                if (cnt == 0)
                {
                    cnt++;
                    x = i;
                }
                else if (j < x)
                {
                    cnt++;
                    x = x < i ? x : i;
                }
                break;
            }
        }
    }
    return cnt;
}

int maxNonOverlappingOpt(vector<int> &a, int target)
{
    int n = a.size();
    map<int, int> pos;
    int sum = 0, count = 0;
    pos[0] = 0;
    vector<int> dp(n + 1);
    for (int i = 0; i < n; ++i)
    {
        sum += a[i];
        int x = sum - target;
        dp[i + 1] = dp[i];
        if (pos.count(x))
        {
            cout << "inside " << i << " " << dp[i + 1] << " " << dp[pos[x]] + 1 << "\n";
            dp[i + 1] = max(dp[i + 1], dp[pos[x]] + 1);
        }
        count = max(count, dp[i + 1]);
        pos[sum] = i + 1;
    }
    cout << "map\n";
    for (pair<int, int> pr : pos)
    {
        cout << pr.first << " " << pr.second << "\n";
    }
    cout << "dp\n";
    for (int val : dp)
    {
        cout << val << " ";
    }
    cout << "\n";
    return count;
}

